// import {Link} from 'react-router-dom';
import "./style.css";
import DropdownItem from '../DropdownItem';

export default function DropdownMenu () {
    function DropdownItem(props) {
      return (
        <a href="#" className="menu-item">
          {props}
        </a>
      )
    }

    return (
      <div className="dropdown">

      </div>
    );
}
